import "./App.css";
import React, { useState } from "react";

function App() {
  const [value, setValue] = useState("");

  return (
    <>
      <input
        type="text"
        value={value}
        onChange={(e) => {
          setValue(() => e.target.value);
        }}
        placeholder="Enter Text"
      />
      <p></p>
    </>
  );
}

export default App;
